import { Row, Col } from "antd";
import { withTranslation } from "react-i18next";
import { Slide, Zoom } from "react-awesome-reveal";
import { ButtonPers } from "../../common/Button";
import Grid from '@material-ui/core/Grid';
import { 
  BlockContainer,
  Span, 
  ButtonContainer, 
  GenContainer, 
  Container,
  TextWrapper,
  Content,
} from "./styles";


const Contact = () => {

  return (
    <GenContainer style ={ { backgroundImage: "url('https://themekaverse.com/images/sky.jpg')" } }>
      <BlockContainer>
        <Grid container spacing={3}>

          <Grid item xs={12} sm={6}>      
            <Slide direction="left">
              <Span>
                <Container>
                  <h1>Join the community</h1>
                  <TextWrapper>
                    <Content>If you want to join the #WIBAGANG itâ€™s here. Join us to get the news as soon as possible and follow our latest announcements.</Content>
                  </TextWrapper>
                </Container>
              </Span>
            </Slide>
          </Grid>

          <Grid container justify="center" xs={12} sm={6} style={{ alignContent:"center", alignItems:"center" }}  >  
            <Slide direction="right">
              <a href="" target="_blank">
                <ButtonContainer >
                  <ButtonPers>Join our Discord</ButtonPers>
                </ButtonContainer>
              </a>
            </Slide>
          </Grid>

        </Grid>
      </BlockContainer>
    </GenContainer>
  );
};

export default withTranslation()(Contact);
